import React, { useState } from 'react';


const MyForm = () => {
    const [name, setname] = useState("");

    return (
        <form>
            <label>Enter Your Name :
                <input 
                    type="text"
                    value={name}
                    onChange = { (elem) => setname(elem.target.value)}
                />
            </label>
        </form>
    )
}

export default MyForm;
